"use strict";(self.webpackChunkdigital_garden=self.webpackChunkdigital_garden||[]).push([[92291],{26282:e=>{e.exports=JSON.parse('{"label":"digital-garden","permalink":"/docs/tags/digital-garden","allTagsPath":"/docs/tags","count":40,"items":[{"id":"Books/Book Reviews/A Field Guide to Lies","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is akin to calling bullshit, where it goes through all the ways people fool themselves and others. The book might make you too aware and skeptical of everything.","permalink":"/docs/Books/Book Reviews/A Field Guide to Lies"},{"id":"Books/Book Reviews/Alchemy","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about the lack of knowledge and the dangers of trying to be \\"too\\" scientific.  It goes into the different aspects of human nature that is difficult to explain.","permalink":"/docs/Books/Book Reviews/Alchemy"},{"id":"Books/Book Reviews/Fundamentals of Data Engineering","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book covers the fundamentals of data engineering and how to solve problems. of data engineering without going to much into detail of the programming. It introduces concepts such as data warehouse and Kafka and data pipelines and ETL.","permalink":"/docs/Books/Book Reviews/Fundamentals of Data Engineering"},{"id":"Books/Book Reviews/I Moved Your Cheese","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is a fairy tale about mice and labyrinths. The characters of Max, Big, and Zed are musing on the fact that the mice are all in the maze and looking for cheese when there is no one asking why the cheese is always being moved around.","permalink":"/docs/Books/Book Reviews/I Moved Your Cheese"},{"id":"Books/Book Reviews/Machine Learning Design Patterns","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about machine learning design patterns and discussions around those\u2014concepts in machine learning for this. And therefore, it is a good reminder of the concepts and core tenants of machine learning.","permalink":"/docs/Books/Book Reviews/Machine Learning Design Patterns"},{"id":"Books/Book Reviews/Peopleware","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book addresses the elephant in the software room, that people, not tech, are the obstacle. Tech is just there to be applied; solving the problem requires a lot of people and knowledge to go the right way. It also addresses how to solve this problem for humans.","permalink":"/docs/Books/Book Reviews/Peopleware"},{"id":"Books/Book Reviews/Personal MBA","title":"\ud83d\ude80 The Book in 3 Sentences","description":"A book with small but interesting stories and lessons. It is meant to concretize a master in business and administration into a single magnum opus. Its lessons are short but interesting.","permalink":"/docs/Books/Book Reviews/Personal MBA"},{"id":"Books/Book Reviews/Practical MLOps","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is a no-nonsense book about practical MLOps and how you should approach it to solve business problems. The book takes an even more hardline approach to automation and focuses on the concept of Kaizen ML, where continuous improvement and striving to make the feedback loop even shorter and the process more and more seamless.","permalink":"/docs/Books/Book Reviews/Practical MLOps"},{"id":"Books/Book Reviews/Practical Recommendation Systems","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is an easy and good introduction to recommendation systems. It is meant to introduce the concept of recommendation systems and, from there, give concepts and methods on how to make them. This book is about usage rather than the theoretical background.","permalink":"/docs/Books/Book Reviews/Practical Recommendation Systems"},{"id":"Books/Book Reviews/Python Tricks","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is just a lot of neet tricks to use in python.  It contains knowledge about structures in python, wrappers to use, and a lot of lot more. Nice for a developer with some python knowledge.","permalink":"/docs/Books/Book Reviews/Python Tricks"},{"id":"Books/Book Reviews/The Brothers Karamazov","title":"\ud83d\ude80 The Book in 3 Sentences","description":"It is a book that involves morality, love, and spirituality. It is a crime story with the morals of the characters being put on trial.","permalink":"/docs/Books/Book Reviews/The Brothers Karamazov"},{"id":"Books/Book Reviews/The Capitalist Manifesto","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is a homage to the progress that capitalism has brought. It is an interesting comparison to the doom and gloom books. It is a book about the fantastic increase in wealth and prosperity that capitalism has brought.","permalink":"/docs/Books/Book Reviews/The Capitalist Manifesto"},{"id":"Books/Book Reviews/Why Orwell Matters","title":"\ud83d\ude80 The Book in 3 Sentences","description":"Hitchens calmly and effectively demolishes the right, the left, and all others who have taken Orwell\'s name in vain. He delves into the absurd scenarios in 1984 and Animal Farm and highlights the same exact scenarios from real-life scenarios.  Imperialism, Fascism, and Communism, the great calamities of the 19th century, are shown through the lens of Orwell, and also how he always lands on the right side of history.","permalink":"/docs/Books/Book Reviews/Why Orwell Matters"},{"id":"Working/Agile","title":"Aglie","description":"Planning Poker","permalink":"/docs/Working/Agile"},{"id":"AI/AI Strategy","title":"AI Strategy","description":"AI strategy is about having a clear view of how to enable the organization to utilize AI capabilities. An AI strategy should encompass the following subsets of strategies.","permalink":"/docs/AI/AI Strategy"},{"id":"Career/Career","title":"Career","description":"Here I write about career and about how to better oneself in one\'s career.","permalink":"/docs/Career/"},{"id":"AI/Data Science/Computer Vision","title":"Computer Vision","description":"Vision Transformer","permalink":"/docs/AI/Data Science/Computer Vision"},{"id":"CyberSecurity/CyberSecurity","title":"CyberSecurity","description":"Penetration testing is essentially simulating attacks and investigating the consequences of said attacks. The end goal is not to get hacked.","permalink":"/docs/CyberSecurity/"},{"id":"AI/Data Science/Data Science Project Start-Up Phase","title":"Data Science Project Start-Up Phase","description":"The start-up phase of a data science project is for me one of the most exciting parts of the project, but it is also one of the most unclear phases. To have a fighting chance of making it to production, there are several factors that are extremely important and need to be addressed.","permalink":"/docs/AI/Data Science/Data Science Project Start-Up Phase"},{"id":"Decision","title":"Decision","description":"In order to make better decisions, I try to structure and stabilize the process for making big decisions.  I define a big decision as a decision that will affect you every day of your life for no shorter than 3 months or for a large duration of time every year (Every weekend for the rest of the year for example). This means that things such as accepting a job offer and moving in with your spouse in a new place are categorized as big decisions.","permalink":"/docs/Decision"},{"id":"Travel/Places/Sapporo and Niseko","title":"Description","description":"Sapporo is a city in Hokkaido Japan. It is very far north, and it is cold there. It is also an excellent place to go skiing.  Sapporo is quite a big City, Niseko is more of a village with skiing slopes and some large resorts nearby.","permalink":"/docs/Travel/Places/Sapporo and Niseko"},{"id":"Music/Discover and Sharing","title":"Discover and Sharing","description":"I try to expand my musical horizon as much as possible. So that I can have music for all my moods and situations. Most of all, the music I discover is either through Spotify or YouTube, but sometimes I think that the best experiences are going to a festival or concert and getting introduced to new artists.","permalink":"/docs/Music/Discover and Sharing"},{"id":"Food/Drink","title":"Drink","description":"-","permalink":"/docs/Food/Drink"},{"id":"Programming/Python/FastAPI","title":"FastAPI","description":"I like Fastapi as a backend service. It is very easy to learn and it is good when designing apis.","permalink":"/docs/Programming/Python/FastAPI"},{"id":"AI/Data Science/Feature Engineering","title":"Feature Engineering","description":"Dummy vs One-hot","permalink":"/docs/AI/Data Science/Feature Engineering"},{"id":"DevOps/Git","title":"Git","description":"Git was developed by Linus Torvalds, who also developed the operating system Linux.  He jokingly said he named both tools after himself. Git was made because making changes and collaborating on Linux had become too challenging and a new way of doing version control was needed.","permalink":"/docs/DevOps/Git"},{"id":"Food/Kitchen","title":"Kitchen","description":"Cutting techniques","permalink":"/docs/Food/Kitchen"},{"id":"Working/Management","title":"Management","description":"- Some work on the management from an engineering perspective","permalink":"/docs/Working/Management"},{"id":"Mac/Obsidian","title":"Obsidian","description":"Obsidian is the tool I use for storing information and writing down the experiences and knowledge I accumulate.","permalink":"/docs/Mac/Obsidian"},{"id":"Obsidian/Obsidian","title":"Obsidian","description":"Obsidian is where I store my knowledge. I use it as a tool for writing, for storing information and knowledge, and for remembering. The main point of using obsidian is that it is living on your personal computer, can be treated as a good tool for writing quickly and also can be integrated with a lot of different tools, which probably is a huge advantage.","permalink":"/docs/Obsidian/"},{"id":"Food/Recipes/Pasta","title":"Pasta","description":"- Venetian Crab and Prosecco Linguine Pasta and Frutti di Mare :P, a delightful summer dish that is fresh and","permalink":"/docs/Food/Recipes/Pasta"},{"id":"Personal","title":"Personal","description":"My Knowledge Wiki contains most of my knowledge (From 2023 onwards mostly). I try to gather all information I find interesting and my learnings in this wiki. The goal is to create a digital garden for my thoughts and share as much as possible of the things I find interesting. The goal is to have a comprehensive library for my thoughts and experiences that I can share with the world and look back on.","permalink":"/docs/Personal"},{"id":"Database/Postgres","title":"Postgres","description":"Open-source database.","permalink":"/docs/Database/Postgres"},{"id":"Productivity/Productivity Theory","title":"Productivity Theory","description":"Gilb\xb4s Law","permalink":"/docs/Productivity/Productivity Theory"},{"id":"Food/Recipes/Recipes to try","title":"Recipes to try","description":"- Carne Asada Looks like a good way to expand the Mexican cuisine.","permalink":"/docs/Food/Recipes/Recipes to try"},{"id":"AI/Data Science/Recommendation Systems","title":"Recommendation Systems","description":"There are two types of recommendation systems","permalink":"/docs/AI/Data Science/Recommendation Systems"},{"id":"Programming/Rust","title":"Rust","description":"- shill rust","permalink":"/docs/Programming/Rust"},{"id":"Database/Snowflake","title":"Snowflake","description":"Snowflake is a company providing a data warehouse.","permalink":"/docs/Database/Snowflake"},{"id":"Learning/Talks","title":"Talks","description":"List of talks that I have found intersting","permalink":"/docs/Learning/Talks"},{"id":"Thinking/Thinking","title":"Thinking","description":"- Normalization of Deviance","permalink":"/docs/Thinking/"}],"unlisted":false}')}}]);